import React from "react";
import Footer from "../parts/Footer";
import Navbar from "../parts/Navbar";
import Event from "../parts/Event";
import EventsHead from "../parts/EventsHead";

const Events = () => {
  return (
    <>
      <Navbar />
      <EventsHead/>
      <Event />
      <Footer />
    </>
  );
};

export default Events;
